const styles = {
  display: 'flex',
  justifyContent: 'space-between',
  border: '2px solid',
  width: '100%',
  height: '40px',
  borderRadius: '5px',
  color: 'white',
}

function TodoItem({ text, completed }){
    return(
      <li style={styles}>
        <span>V</span>
        <p>{text}</p>
        <span>X</span>
      </li>
    )
}

export default TodoItem
